; 管理学院实验中心下设：信息管理系统、人力资源管理、综合实验室、会计电算化实验室、会计模拟及企业经营模拟五个实验室；并与“信息产业部电子行业职业技能鉴定指导中心”合作建成“企业信息化综合技能人才培养基地”，学生通过在该基地的模拟实习，可以参加信息产业部的职业技能考试并获专业上岗证书，为毕业后的就业奠定良好的基础。实验室中心总面积近<span lang=\"EN-US\">500</span><span>㎡。专职实验人员</span><span lang=\"EN-US\">4</span><span>名，实验课程任课教师</span><span lang=\"EN-US\">20</span><span>余名。</span><span> </span><span>已开设涵盖管理学院</span><span lang=\"EN-US\">7</span><span>个本科专业、共计</span><span lang=\"EN-US\">30</span><span>余门基础课程以及专业课程的实验内容。</span></p><p><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><span>实验中心的所有实验室面向全校师生员工及社会相关人士开放，为学生在校期间的教学、实践环节提供支持和保障，服务于学院的教学、科研工作，积极努力提升自身的技术水平，推动科研成果的转化。</span></p><p align=\"center\"><span></span></p><p align=\"center\"><span></span>&nbsp;</p>','2015-09-08 09:19:04','admin','admin',28,NULL,'简介','/upload/2015-09-08/4c60e39403ec4958bf4663944495763c.gif',NULL),(47,'人力资源软件培训','<p>2018年5月25日下午，实验中心进行了人力资源软件培训。</p><p><img src=\"/upload/2018-05-28/9fd37d0008394c0898fd47eccd91e5d2.jpg\" width=\"600\" height=\"480\" alt=\"\" /></p>','2018-05-28 12:31:02','白晓波','实验中心',53,NULL,'人力资源 培训','/upload/2018-05-28/9fd37d0008394c0898fd47eccd91e5d2.jpg',NULL),(48,'实验中心安全演练','<p align=\"center\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2019年6月21日上午9时许，在王保忠副院长和保卫处领导的指导下，管理学院在人文楼成功举行了一次实验室紧急疏散消防演习。全院360名师生参加了此次演习，兄弟学院相关领导观摩了演习。</p><p>为了确保疏散演习紧张有序地开展，管理学院和保卫处各职能部门作了充分的准备，特地成立了紧急疏散领导小组，下设现场指挥组、疏散引导组、报警组、灭火组、警戒组等进行组织与协调。 </p><p>﻿﻿<img src=\"/upload/2019-12-20/a99e0378dcbb47a787ae2f5bf3590e33.jpeg\" width=\"480\" height=\"600\" alt=\"\" /></p><p><img src=\"/upload/2019-12-20/66bc62269ec24a5988a8ec13aa97bf0c.jpg\" width=\"480\" height=\"600\" alt=\"\" /><br /></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 在指挥组组长王保忠副院长下达“演习开始”的指令后，消防演习各项工作忙碌而有序的展开。报警组首先发现火情后立即向中控室报警，中控室接到报警后随即广播通知各楼层进行疏散，各楼层师生在疏散引导组的引导下安静、有序、快速的按照疏散演习预案要求用湿毛巾捂住口、鼻，低姿靠右侧从事故现场有序撤离，灭火组接到报警后迅速赶到现场进行灭火演练，消防疏散演习在各职能部门的通力协作下，在全体师生的积极配合下顺利完成，达到了预期效果。 </p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 本次消防逃生演习，帮助学院师生掌握了必要的火灾预防常识和逃生自救互救技能，检验消防应急预案的合理性和可行性，检查了消防设施设备的完好性，检验了紧急疏散工作组各职能部门在应付突发事件时相互配合、应急管理、指挥调度、疏散引导等工作的及时迅速和准确到位。（管理学院韩翠鸥供稿，王保忠审核）</p><p><br /></p><p><br /></p>','2019-12-20 12:54:57','白晓波','实验中心',53,NULL,'安全，演练','/upload/2019-12-20/66bc62269ec24a5988a8ec13aa97bf0c.jpg',NULL),(49,'实验室安全教育','&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;<span>随着高等教育事业的发展，高校实验环境和硬件设施都得到了明显的改善和提升。但是发展的背后还存在着很多隐患，高校火灾、爆炸、投毒、中毒、危险品丢失等实验室安全事故时有发生，严重威胁着实验老师和同学们的生命安全。<span lang=\"EN-US\"><o:p></o:p></span></span><p><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 为了在学生心中形成“安全第一”的实验室氛围，使广大学生了解更多的实验安全常识，提高安全防范意识，真正将实验安全知识运用到实验生活中，真正落实“安全上心，实验顺心”的方针，保证学生在实验中的安全，管理学院于<span lang=\"EN-US\">2019</span>年<span lang=\"EN-US\">9</span>月<span lang=\"EN-US\">20</span>日在管理学院实验室主办了“实验室管理专题培训讲座”。分两场分别对本学院全体学生进行了安全教育。<span lang=\"EN-US\"><o:p></o:p></span></span></p><p><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 首先主持人宣布活动开始，并介绍到场嘉宾。管理学院党委书记徐焕章、王保忠副院长、王渊副院长及全体教师参与出席此次活动。</span></p><span></span><p><span lang=\"EN-US\"><o:p><img alt=\"\" src=\"/upload/2019-12-20/7dca92537ec742cfbc51fe03e1cda3f1.jpg\" /></o:p></span></p><span lang=\"EN-US\"><o:p><p><span>讲座由王保忠副院长主讲，分为四部分。实验室事故案例、危险化学品讲解及解析、相关法律法规学习、危化品的申请流程等。</span><span lang=\"EN-US\"><o:p></o:p></span></p><p><span>王院长通过对高校几起实验室事故的分析，讲述了安全隐患原因主要有以下几方面：实验室安全意识淡薄；学生实验操作不够规范；一些易燃、易爆、剧毒等危险化学品存放不够规范；对剧毒品、危险品的管理不够严格，防火、防爆意识淡薄。之后，实验室老师又对易燃物、腐蚀性物质、压缩气体等八种实验室常见危险化学品进行知识普及，教育同学们日常做实验时应注意哪些问题，当遇到突发情况时应如何保护自己。</span><span lang=\"EN-US\"><o:p></o:p></span></p><p><span>在经过法律条令和危化品领用申请表的学习后，同学们真正了解了实验室药品的危险等级和程度，熟悉了防护设备的使用并掌握了相关预防措施和紧急处理方法。杜院长明确强调，关键还是要自己重视，时时牢记实验室安全问题。</span><span lang=\"EN-US\"><o:p></o:p></span></p><p><span lang=\"EN-US\">“</span><span>隐患险于明火，防范胜于救灾，责任重于泰山</span><span lang=\"EN-US\">”</span><span>。</span><span>无论从实验室的使用功能，还是从实验室的自身发展来看，我们都应该强调把实验室的安全防范作为实验室管理的基础。切实做好实验室安全工作。</span><span lang=\"EN-US\"><o:p></o:p></span></p><p></p></o:p></span>&nbsp;<p><span lang=\"EN-US\"><o:p></o:p></span>&nbsp;</p>','2019-12-20 13:00:21','白晓波','实验中心',53,NULL,'实验室，安全','/upload/2019-12-20/7dca92537ec742cfbc51fe03e1cda3f1.jpg',NULL);

