insert  into `tb_logs`(`sid`,`file_path`,`ctime`,`uid`,`y_term_id`,`y_week_th`,`title`) values (14,NULL,'2017-11-06',1,7,11,'405实验室11台设备维护，安装SAP软件。'),(15,NULL,'2017-11-07',1,7,11,'实验管理处要求填写资产与实验室对应表格，课程与实验室对应表格。'),(19,NULL,'2017-11-08',1,7,11,'405实验室极域电子教室软件安装测试。412管理信息系统教学软件安装。'),(20,'upload/2017-11-14/6918e3ab97544dccbc5a6b52198e95ab.xlsx','2017-11-14',1,7,12,'服务器例行检查'),(21,NULL,'2017-11-15',1,7,12,'405实验室学生机极域电子教室安装，经测试能够和教师机互动。'),(23,'upload/2017-12-05/c55d54ff9ae14030a84d4be75e8e161e.xlsx','2017-12-05',1,7,15,'设备例行检查'),(24,NULL,'2018-05-28',1,8,13,'设备例行维护'),(25,NULL,'2018-06-06',1,8,14,'402服务器系统维护'),(26,NULL,'2018-06-07',1,8,14,'402服务器系统维护'),(27,NULL,'2018-06-08',1,8,14,'402服务器系统维护'),(28,NULL,'2018-06-25',1,8,17,'人力资源测评软件维护'),(29,NULL,'2018-09-28',1,9,4,'福思特财会软件维护'),(30,NULL,'2018-09-28',1,9,4,'411实验室设备维护'),(31,NULL,'2018-11-15',1,9,11,'412机房用友软件维护'),(32,NULL,'2018-11-15',1,9,11,'412试验试验网络维护'),(33,NULL,'2019-01-14',1,9,20,'创业之星软件所在服务器（412教室）系统中病毒，软件不能正常启动。从早上8:15对问题进行处理，于下午15:41分处理完毕。经测试，能够正常使用。'),(34,NULL,'2019-02-25',1,10,1,'协助412实验室用友U8软件安装'),(35,NULL,'2019-03-01',1,10,2,'从下午2点开始到5:30，处理412的spss22软件安装，411实验室的软件更新后的系统重做。'),(36,NULL,'2019-03-07',1,10,2,'下午2点至4点，411实验室后两排电脑系统重做。'),(37,NULL,'2019-03-08',1,10,2,'早上处理411剩余两台电脑的系统问题。'),(38,NULL,'2019-03-18',1,10,4,'405实验室徳意电子商务软件维护'),(39,NULL,'2019-03-21',1,10,4,'411学生机，405教师机软件安装'),(40,NULL,'2019-04-08',1,10,7,'处理411实验室SPSS22软件。'),(41,NULL,'2019-04-15',1,10,8,'405实验室SPSS22安装，Eview9安装，系统重做。'),(42,NULL,'2019-04-17',1,10,8,'412创业总动员软件安装。'),(43,NULL,'2019-05-13',1,10,12,'处理405实验室教师机 SQLServer2005 不能使用的问题。经重新安装，服务程序更新后可以使用。'),(44,NULL,'2019-05-24',1,10,13,'周一至周四处理412网络和服务器操作系统，经处理412网络正常，服务器需要重新安装Server2003系统，网络下载的，经测试不能使用，需要购买。'),(45,NULL,'2019-06-20',1,10,17,'402服务器人力资源实验软件处理'),(46,NULL,'2019-08-28',1,11,1,'405实验室系统重做。'),(47,NULL,'2019-09-09',1,11,3,'SAP软件调试。412故障电脑处理。'),(48,NULL,'2019-10-08',1,11,7,'9:30-14:00。402服务器上的创业总动员和创业之星服务端软件处理与调试。'),(49,NULL,'2019-10-09',1,11,7,'踏瑞人力测评软件故障处理。'),(50,NULL,'2019-10-10',1,11,7,'411实验室5台学生机故障处理，412实验室网络和1台学生机故障处理。'),(51,NULL,'2019-12-07',1,11,15,'12月3-6日，处理412,411和405学生机系统和软硬件问题。'),(52,NULL,'2020-08-29',1,12,1,'服务器搬迁、安装，网络测试，实验预约系统安装测试。'),(53,NULL,'2020-09-04',1,12,1,'411实验室所有电脑系统重做。'),(54,NULL,'2021-03-16',1,13,3,'3月11日，412路由器，交换机安装测试。'),(55,NULL,'2021-03-16',1,13,3,'3月12日，404服务器交换机，网线调整。'),(56,NULL,'2021-03-16',1,13,3,'3月15,3月16,405学生机系统维护，安装。'),(57,NULL,'2021-03-23',1,13,4,'全天，412学生机处理。'),(58,NULL,'2021-03-26',1,13,4,'412服务器维护，405Eview9问题处理。'),(59,NULL,'2021-03-31',1,13,5,'03月30日，412教师机电子教室，SPSS22安装，学生机SPSS安装，25台学生机维护。'),(60,NULL,'2021-03-31',1,13,5,'3月31日，412服务器维护！'),(61,NULL,'2021-03-31',1,13,5,'处理506学生机不断重启，蓝屏问题。'),(62,NULL,'2021-04-15',1,13,7,'405实验室 Eview9 注册，同传。'),(63,NULL,'2021-04-23',1,13,8,'411实验室创业之星安装（学生端）'),(64,NULL,'2021-04-26',1,13,9,'4月25日，412，411,教师机，创业之星，教师管理端软件。'),(65,NULL,'2021-05-17',1,13,12,'5月14日，解决412服务器网络故障'),(66,NULL,'2021-05-18',1,13,12,'5月17日,5月18日，512,学生机维修，交换机测试。'),(67,NULL,'2021-05-26',1,13,13,'5月19至5月21日，处理电脑不断重启蓝屏问题，具体思路，防火墙，屏蔽在没有程序使用网络时，却在访问网络的进程。'),(68,NULL,'2021-06-11',1,13,19,'6月8日，大概1天时间，处理512实验室约12台学生机的重启，蓝屏问题。');

