/*Table structure for table `v_work_logs` */

DROP TABLE IF EXISTS `v_work_logs`;

/*!50001 DROP VIEW IF EXISTS `v_work_logs` */;
/*!50001 DROP TABLE IF EXISTS `v_work_logs` */;

/*!50001 CREATE TABLE `v_work_logs` (
  `sid` int(11) NOT NULL DEFAULT '0',
  `title` varchar(512) CHARACTER SET utf8 DEFAULT NULL COMMENT '主题',
  `file_path` varchar(255) CHARACTER SET utf8 DEFAULT NULL,
  `ctime` date DEFAULT NULL,
  `uname` varchar(32) CHARACTER SET utf8 DEFAULT NULL,
  `syt` varchar(64) CHARACTER SET utf8 DEFAULT NULL,
  `y_week_th` int(11) DEFAULT NULL COMMENT '哪一周的',
  `yt_id` int(11) NOT NULL DEFAULT '0',
  `uid` int(11) NOT NULL DEFAULT '0'
) ENGINE=InnoDB DEFAULT CHARSET=gbk */;

/*View structure for view v_work_logs */

/*!50001 DROP TABLE IF EXISTS `v_work_logs` */;
/*!50001 DROP VIEW IF EXISTS `v_work_logs` */;

